import React from 'react';
import { faCircleInfo, faHouse, faUser } from '@fortawesome/free-solid-svg-icons';

export const SidebarData = [
  {
    title: 'Home',
    path: '/',
    icon: faHouse,
    cName: 'nav-text' //classname
  },
  {
    title: 'Account',
    path: '/account',
    icon: faUser,
    cName: 'nav-text'
  },
  {
    title: 'About',
    path: '/about',
    icon: faCircleInfo,
    cName: 'nav-text'
  },
];
